import React, { useState, useEffect } from "react";
import Nav from "../Nav/Nav";

function MyItinerary() {

  const MyItinerary = ({ userId, onselect }) => {
    const[itineraries, setItineraries] = useState([]);

    useEffect(() => {
        fetch(`http://Localhost:5000/itineraries/${userId}`)
        .then((res) => res.json())
        .then (setItineraries)
        .catch (console.error);
    },[userId]);

  };

  return (
    <div>
      <Nav />
      <h3>All Itineraries</h3>
      <ul>
        {itineraries.map((itinerary) => (
            <li key={itinerary._id} onclick={() => onselect(itinerary)}>
                {itinerary.tripName} {itinerary.destination}
            </li>
        ))}
      </ul>
    </div>
  );
}

export default MyItinerary;
